import './App.css';
import {
  BrowserRouter,
  Routes,
  Route,
  Link
} from "react-router-dom";

function hv()
{
  <h1>Hola soy la funcion de la hoja de vida</h1>
}

function App() {
  return (
    <BrowserRouter>
      <nav class="menu">
        <ul>
          <li>
            <Link to="/"> Hoja de vida Juan Felipe</Link>
          </li>
          <li>
          <Link to="/"> Hoja de vida Maria Fernanda</Link>
          </li>
          <li>
          <Link to="/"> Contactanos</Link>
          </li>
        </ul>
        <Routes>
          <Route path="/" element={<hv/>}/>
          <Route path="/Hoja de vida" element={<hv/>}/>
        </Routes>
      </nav>
    </BrowserRouter>
  );
}

export default App;
